import { Component } from '@angular/core';

@Component({
  selector: 'app-registation',
  templateUrl: './registation.component.html',
  styleUrls: ['./registation.component.css']
})
export class RegistationComponent {

  username!: string;
  email!: string;
  password!: string;
  number!: number;

  onSubmit() {
    // Perform registration logic here, e.g. send data to a backend API
    console.log('Registration form submitted:', this.username, this.email, this.password,this.number);
    // Add your registration logic here
  }
}




<h2 class="text-center">Registration Here</h2>

<div class="container">
  <h2>Registration</h2>
  <form (ngSubmit)="onSubmit()">
    <div class="form-group">
      <label for="username">Username:</label>
      <input type="text" id="username" name="username" [(ngModel)]="username" class="form-control" required>
    </div>
    <div class="form-group">
      <label for="email">Email:</label>
      <input type="email" id="email" name="email" [(ngModel)]="email" class="form-control" required>
    </div>
    <div class="form-group">
      <label for="password">Password:</label>
      <input type="password" id="password" name="password" [(ngModel)]="password" class="form-control" required>
    </div>
    <div class="form-group">
      <label for="gender">Gender:</label>
      <select id="gender" name="gender" [(ngModel)]="gender" class="form-control" required>
        <option value="">Select</option>
        <option value="male">Male</option>
        <option value="female">Female</option>
        <option value="other">Other</option>
      </select>
    </div>
    <button type="submit" class="btn btn-primary">Register</button>
  </form>
</div>

<div class="container">
  <img src="../../assets/Screenshot (215).png">

</div>
